VIZ.init = function(_onReady){
	this.onReady = _onReady;
	this.start();
}


VIZ.start = function(){

	this.scene = new THREE.Scene();
	this.camera = new THREE.PerspectiveCamera(this.CAMERA_FOV, window.innerWidth / window.innerHeight , 0.1, 1000);
	this.camera.position.z = this.CAMERA_Z;//130
	//this.camera.lookAt(VIZ.scene.position);
	
	this.renderer = new THREE.WebGLRenderer({ antialias: true });
	this.renderer.setSize(window.innerWidth, window.innerHeight);
	//this.renderer.setClearColor(0x00ffff);
	/*
	var spotLight = new THREE.SpotLight( 0xffffff );
	spotLight.position.set( -40, 60, -10 );
	scene.add(spotLight );
	*/
	
	this.clock = new THREE.Clock();

	$(this.DOM_CONTAINER).append(this.renderer.domElement);
	$(this.DOM_CONTAINER).css({
		position: "relative",
		width: "100%",
		height: "100%",
		zIndex:-1
	});

	this.renderScene();
	
	document.onmousemove = this.handleMouseMove;
	window.addEventListener( 'resize', this.onWindowResize.bind(this), false );
	this.onWindowResize();
	this.mouse_x = this.mouse_xt = this.STAGE_WH;
	this.mouse_y = this.mouse_yt = this.STAGE_HH;
	
	this.initModules();
	 //!!!
	if(this.MOUSE_POSITION_DEBUG){
		var sphere_g = new THREE.SphereGeometry( 2, 8, 8 );
		var material = new THREE.MeshBasicMaterial( {color: 0xffff00} );
		var MousePosSphere = new THREE.Mesh( sphere_g, material );
		this.MousePosSphere = MousePosSphere;
		this.scene.add( MousePosSphere );
	}
	 //!!!
	
	//!!! STATS !!!
	if(Stats){
		this.STATS = new Stats();
		this.STATS.domElement.style.position = 'absolute';
		this.STATS.domElement.style.top = '0px';
		this.STATS.domElement.style.right = '0px';
		document.body.appendChild( this.STATS.domElement );
	}
	//!!! STATS !!!

	//renderer.domElement.addEventListener( 'click', stageClick, false );
	if(this.onReady) this.onReady();
}

