VIZ.getMousePosition = function(){
	// cursor's screen to 3d space projection
	var m_vector = new THREE.Vector3();
	m_vector.set( VIZ.view_coef_x/2.2, -VIZ.view_coef_y/2.2, .5 );
	m_vector.unproject( VIZ.camera );
	var m_dir = m_vector.sub( VIZ.camera.position ).normalize();
	var m_distance = - VIZ.camera.position.z / m_dir.z;
	var mouse_pos = VIZ.camera.position.clone().add( m_dir.multiplyScalar( m_distance ) );
	//if(this.MOUSE_POSITION_DEBUG) this.MousePosSphere.position.set( mouse_pos.x, mouse_pos.y, mouse_pos.z );
	//console.log(">> ",mouse_pos);
	return mouse_pos;
}

VIZ.handleMouseMove = function(event) {
	var dot, eventDoc, doc, body, pageX, pageY;
	event = event || window.event; // IE-ism
	// If pageX/Y aren't available and clientX/Y are,
	// calculate pageX/Y - logic taken from jQuery.
	// (This is to support old IE)
	if (event.pageX == null && event.clientX != null) {
		eventDoc = (event.target && event.target.ownerDocument) || document;
		doc = eventDoc.documentElement;
		body = eventDoc.body;

		event.pageX = event.clientX +
		  (doc && doc.scrollLeft || body && body.scrollLeft || 0) -
		  (doc && doc.clientLeft || body && body.clientLeft || 0);
		event.pageY = event.clientY +
		  (doc && doc.scrollTop  || body && body.scrollTop  || 0) -
		  (doc && doc.clientTop  || body && body.clientTop  || 0 );
	}
	VIZ.mouse_x = event.pageX;
	VIZ.mouse_y = event.pageY;
}

//----------------------
// t - time
// b - start value
// c - end value
// d - duration
Math.easeInOutSine = function (t, b, c, d) {
	return -c/2 * (Math.cos(Math.PI*t/d) - 1) + b;
};

Math.easeInOutElastic = function(t, b, c, d) {
	/* var ts=(t/=d)*t;
	var tc=ts*t;
	return b+c*(33*tc*ts + -106*ts*ts + 126*tc + -67*ts + 15*t); */
	var s=1.70158;var p=0;var a=c;
	if (t==0) return b;  if ((t/=d/2)==2) return b+c;  if (!p) p=d*(.3*1.5);
	if (a < Math.abs(c)) { a=c; var s=p/4; }
	else var s = p/(2*Math.PI) * Math.asin (c/a);
	if (t < 1) return -.5*(a*Math.pow(2,10*(t-=1)) * Math.sin( (t*d-s)*(2*Math.PI)/p )) + b;
	return a*Math.pow(2,-10*(t-=1)) * Math.sin( (t*d-s)*(2*Math.PI)/p )*.5 + c + b;
}

Math.remap = function (value, low1, high1, low2, high2) {
    return low2 + (high2 - low2) * (value - low1) / (high1 - low1);
}

VIZ.scaleUV = function(g, offset_u, offset_v, scale_u, scale_v){
	var uv = g.faceVertexUvs[0];
	for(var uvs=0; uvs<uv.length; uvs++){
		for(var k=0; k<3; k++){
			var _uv = uv[uvs][k];
			_uv.x = offset_u + _uv.x*scale_u;
			_uv.y = offset_v + _uv.y*scale_v;
		}
	}
	g.uvsNeedUpdate = true;
}
VIZ.BG = {
	is_inited: false,
	is_autoinited: !true,
	rings: [],
	wait_for_texture: '',
	bg_texture_current: '',
	log_prfx: "VIS:BG - ",
	_animation_type: true, // temporary flag used after prload texures
	PLANE_W: 0,// plane width
	TEXTURES: {},
	//BG_TEXTURES: [],
	checkInited: function (s){
		if(!this.is_inited) {
			console.warn(this.log_prfx+"must be is_inited first! ["+s+"]");
		}
		return this.is_inited;
	},

	// callbacks
	onReady: null// when inited
};

VIZ.BG.init = function(_default_texture, _onReady){//, _first_texture){
	if(this.is_inited) {
		console.warn(this.log_prfx+"is_inited already!");
		return;
	}
	if(_onReady) this.onReady = _onReady;

	var texture = this.getTexture(_default_texture);
	if(!texture) {
		console.log('wait');
		this.wait_for_texture = this.getTextureName(_default_texture);
		this.preloadTexture(_default_texture);
		return;
	}

	this.RingContainer = new THREE.Object3D();
	this.RingContainer.visible  = false;
	VIZ.scene.add( this.RingContainer );

	var y_offset = .04;
	var w = 300;
	var step = 4;// width of rings !!!
	var _id = 0;
	for(var i=step; i<w-step; i+= step){
		var g = new THREE.RingGeometry( Math.max(0, i-(step*(1+i/w*5)) ), i, 64, 1 );
		var uv = g.faceVertexUvs[0];
		var coef = i/(w)*1.1;// add some overlap
		for(var j=0; j<uv.length; j++){
			for(var k=0; k<3; k++){
				var _uv = uv[j][k];
				_uv.x = (_uv.x-.5)*coef+.5;
				_uv.y = (_uv.y-.5)*coef+.5 +y_offset;
			}
		}
		var m = new THREE.MeshBasicMaterial( { map: texture } );
		//m.wireframe = true;
		var Ring = new THREE.Mesh( g, m );
		Ring._id = _id;
		Ring.position.z = -i/100;
		this.RingContainer.add( Ring );
		this.rings.push(Ring);
		_id++;
	}
	
	var pw = w*2-step*27*(2/step);
	this.PLANE_W = pw;
	var g = new THREE.PlaneGeometry( pw, pw, 5, 5);
	this.Plane = new THREE.Mesh( g, m );
	this.Plane.visible  = false;
	this.Plane.position.y = -pw*y_offset;
	VIZ.scene.add(this.Plane);
	
	VIZ.onWindowResize();
	this.is_inited = true;

	if(this.onReady) this.onReady();
}

VIZ.BG.showImage = function(_url, _animation_type, _time){
	if(VIZ.LOCK_CAMERA) return;// can't animate bg while it's animated already

	if(!this.checkInited("showImage + "+_url)) return;
	var _nm = this.getTextureName(_url);
	if(_nm==this.bg_texture_current){
		console.warn(this.log_prfx+"image #"+_nm+" is shown already!");
		return;
	}

	var self = this;
	
	//console.log(this.log_prfx+" showImage (",_url+")");
	var texture = this.getTexture(_url);
	if(!texture){
		this.wait_for_texture = this.getTextureName(_url);
		this._animation_type = _animation_type;
		this._animation_time = _time;
		this.preloadTexture(_url);
		return;
	}
	this.bg_texture_current = _nm;

	if(_animation_type == 'no_animation'){
		this.Plane.material.map = texture;
	}else if(_animation_type){
		VIZ.BG.slideEffect(texture, _animation_type, _time);
	}else{
		this.showPlane(false);
		VIZ.BG.boomEffect(texture);
	}
}

VIZ.BG.showPlane = function(_show){
	this.RingContainer.visible = !_show;
	this.Plane.visible = _show;
}

// ---------- ANIMATIONS
VIZ.BG.boomEffect = function(texture){
	var self = this;

	function animate(){
		//if(this.is_last) console.log(this.a_value);
		this.rotation.z = this.a_value * this.a_rotation;
		this.position.z = (1-Math.abs((this.a_value-.5)*2)) * (this._id*.1);
		this.scale.x = this.scale.y = 1 + this.a_value * this.a_scale;
	}

	for(var i=0; i<this.rings.length; i++){
		var ring = this.rings[i];
		
		//
		var ii = (this.rings.length-i)/this.rings.length;
		var t = (.07 + .07*ii)*50;
		var d = i/this.rings.length*25;//(i*.002 + .003*ii)*100;
		ring._time = t;

		ring.a_value = 0;
		ring.a_scale = Math.random()*.1;
		ring.a_rotation = (Math.random()*.4-.2)/2;

		TweenLite.to( ring, t,{
			useFrames: true,
			delay: d,
			a_value: 1,
			ease: Sine.easeOut,
			onUpdate:animate.bind(ring),
			onComplete: function(){
				this.material.map = texture;
				TweenLite.to( this, this._time, {
					useFrames: true,
					a_value: 0,
					ease: Sine.easeInOut,
					onUpdate:animate.bind(this),
					onComplete: function(){
						if(this.is_last) self.showPlane(true);
					}.bind(this)
				});
			}.bind(ring)
		});

		if(i==this.rings.length-1) ring.is_last = true;
		//tl.play();
	}
}

VIZ.BG.slideEffect = function(texture, _direction, _time){
	var self = this;

	var plt = VIZ.BG.getIntersectionPoint(-1,1, this.Plane);
	var prb = VIZ.BG.getIntersectionPoint(1,-1, this.Plane);
	
    if(!prb || !plt) {
    	console.warn("can't check points",prb,plt);
    	return;
    }

    var w = (prb.x - plt.x)*1.1;
    var h = (plt.y - prb.y)*1.1;
    //console.log(w,h);
    var g = new THREE.PlaneGeometry(w,h,5,5);
    var mo = new THREE.MeshBasicMaterial({map:this.Plane.material.map});
    var ox = (this.PLANE_W - w)/2/this.PLANE_W;
    var oy = (this.PLANE_W - h -this.Plane.position.y*2)/2/this.PLANE_W;
    var osx = w/this.PLANE_W;
    var osy = h/this.PLANE_W;
    // console.log(ox,oy,osx,osy);
    VIZ.scaleUV(g, ox, oy, osx, osy);

    var container = new THREE.Object3D();
    container.position.z = .05;
    VIZ.scene.add(container);

    var plane_old = new THREE.Mesh(g,mo);
    
	container.add(plane_old);

	var plane_new  = plane_old.clone();
	var mn = new THREE.MeshBasicMaterial({map:texture});
	plane_new.material = mn;
	container.add(plane_new);

	this.Plane.material.map = texture;
	this.Plane.visible = false;
	VIZ.LOCK_CAMERA = true;

	if(!_time) _time = 1;
	if(!_direction) _direction = "slide_down";
	var dx = 0;
	var dy = 0;
	_direction = _direction.split("_")[1];
	switch(_direction){
		case "up": dy = -h; break;
		case "down": dy = h; break;
		case "left": dx = w; break;
		case "right": dx = -w; break;
	}
	plane_new.position.x = dx;
	plane_new.position.y = dy;
	//console.log(_direction,dx,dy);

    TweenLite.to(container.position, _time,{
    	x: -dx,
    	y: -dy,
    	ease: Sine.easeInOut,
    	onComplete:function(){
    		container.remove(plane_new);
    		delete plane_new;
    		container.remove(plane_old);
    		delete plane_old;
    		VIZ.scene.remove(container);
    		delete container;
    		self.Plane.visible = true;
    		VIZ.LOCK_CAMERA = false;

    		// set material for rings
    		for(var i=0; i<self.rings.length; i++){
				var ring = self.rings[i];
				ring.material.map = texture;
				//if(Math.random()>.5) ring.material.wireframe = true;
			}
			
			//self.RingContainer.visible = true;
    	}
    });
}

VIZ.BG.getIntersectionPoint = function(_screen_x, _screen_y, _object){
	var mp = new THREE.Vector3( _screen_x, _screen_y, 0.5 );
	mp.unproject( VIZ.camera );   
    mp.sub( VIZ.camera.position );                
    mp.normalize();
    var raycaster = new THREE.Raycaster( VIZ.camera.position, mp );
    var intersects = raycaster.intersectObject( _object );
    if ( intersects.length > 0 ) 
    	return intersects[ 0 ].point;
    return null;
}

