VIZ.BG.getTextureName = function(_url){
	var nm = _url.split("/");
	return nm[nm.length-1];
}

VIZ.BG.getTexture = function(_url){
	return this.TEXTURES[this.getTextureName(_url)];
}

VIZ.BG.preloadTexture = function(_url){
	//console.log(this.log_prfx+" preloadTexture (",_url+")");
	var _this = this;
	var loader = new THREE.TextureLoader();		
	loader.load(
		_url,
		function ( texture ) {
			var nm = _this.getTextureName(texture.image.src);
			_this.TEXTURES[nm] = texture;
			var  img_coef = texture.image.width/texture.image.height;
			texture.repeat = new THREE.Vector2(1,img_coef);
			texture.offset = new THREE.Vector2(0,-(1/img_coef)/2);

			//console.log(_this.log_prfx+"texture preloaded");
			if(_this.rings.length<1){
				_this.init(texture.image.src);
				return;
			}else if(_this.wait_for_texture==nm) VIZ.BG.showImage(nm, _this._animation_type, this._animation_time);
			
		},
		function ( xhr ) {
			//console.log( (xhr.loaded / xhr.total * 100) + '% loaded' );
		},
		function ( xhr ) {
			console.log( 'An error happened' );
		}
	);
}
