VIZ.CRIC_DOTS.addCircle = function(r,scl,z){
	var g = new THREE.Geometry();
	var PIdouble = Math.PI*2;
	var step = (100-r)*.0008;//(1-PIdouble*r/1000)/10;
	//console.log(r,step);
	//return;
	var x,y;
	for(var i=0; i<PIdouble-step*.5; i+=step){
		x = Math.cos(i)*r;
		y = Math.sin(i)*r;
		g.vertices.push( new THREE.Vector3(x, y, 0));
    }
	
	var group = new THREE.Group();
	//group._coef = z;
	this.container.add(group);
	var particles = new THREE.ParticleSystem( g, this.DOT_MATERIAL );
	//group.position.z = VIZ.camera.position.z;
	group.add( particles );
	particles.position.z = 100+z;//100+50*z;
	particles.scale.set(scl,scl,scl);
	this.dots.push(group);
}

VIZ.CRIC_DOTS.update = function(){
	if(!this.is_inited) return;
	for(var i=0; i<this.dots.length; i++){
		var c = this.dots[i];
		c.position.x = VIZ.view_coef_x*1;
		c.position.y = -VIZ.view_coef_y*.5;
	}
	
}
