VIZ.LINE_DOTS.addRandomPosition = function (v, a){
	v.x = v.x+Math.random()*a*2-a;
	v.y = v.y+Math.random()*a*2-a;
	v.z = v.z+(Math.random()*a*2-a)/3;
}

VIZ.LINE_DOTS.setCirclePosition = function (v,r,z){
	var t = Math.random()*this.PIdouble;
	v.x = Math.cos(t)*r;
	v.y = Math.sin(t)*r;
	v.z = z;
}

VIZ.LINE_DOTS.setZeroPosition = function (v){
	v.x = v.y = v.z = 0;
}

