VIZ.LINE.init =  function(){
	if(this.is_inited) {
		console.warn(this.log_prfx+"is_inited already!");
		return;
	}
	var max_vertices = 0;
	for(var i=0; i<this.IMAGES.length; i++){
		var nm = this.IMAGES[i];// shape name
		var asset = ASSETS[nm];
		this.createGeometry(nm);
		var target = ASSETS[nm+"_line_geo"].vertices;
		var verex_amount = target.length;
		console.log("Vertex amount of "+nm+' : '+verex_amount,". Original amount is ",ASSETS[nm].length/3);
		if(max_vertices<verex_amount) max_vertices = verex_amount;
	}
	console.log("Overall vertex amount: ",max_vertices);
	this.max_vertices = max_vertices;
	
	//max_vertices = 10;//!!!
	var g = new THREE.Geometry();
	this.geo = g;
	var v;
	for ( i = 0; i < max_vertices; i++ ) {
		v = new THREE.Vector3(0,0,0);
		v.target = new THREE.Vector3(0,0,0);
		v.start = new THREE.Vector3(0,0,0);
		v.delta = new THREE.Vector3(0,0,0);
		v.amp = 0;
		g.vertices.push( v );
		g.colors.push(new THREE.Color( 0xffffff ));
	}
	var m = new THREE.LineBasicMaterial( {
		color: 0xffffff,
		linewidth: 1,
		vertexColors: THREE.VertexColors,
		transparent: true,
		opacity: 0
	});

	var line = new THREE.Line( this.geo, m );
	this.mesh = line;
	line.position.z = VIZ.CAMERA_Z - 15;

	VIZ.scene.add( line );
	this.is_inited = true;
	this.activate();//!!! debug
	
}

VIZ.LINE.activate = function(){
	if(!this.checkInited()) this.init();
	//console.log('LINE is activated');
	
	var v;
	var l = this.geo.vertices.length;
	for(var i=0; i<l; i++){
		v = this.geo.vertices[i];
		this.setLinePosition( v, i );
		//this.setLinePosition( v.start, i );
		this.setLinePosition( v.target, i, 0 );
		//this.setZeroPosition(v.delta);
		this.setDeltaPositionToTarget(v);
		v.offset = .5;
	}

	this.is_complete = false;
	this.is_active = true;
	this.is_paused = false;
	this.mesh.visible = true;
	this.need_deactivate = false;

	this.mesh.material.opacity = 0;
	TweenLite.to( this.mesh.material, 1, {
		opacity: 1,
		ease: Quad.easeOut
	})
}

VIZ.LINE.deactivate = function(){
	if(!this.checkInited()) return;
	if(!this.mesh.visible){
		console.warn(this.log_prfx+"is unactive already!");
		return;
	}
	//console.log("this.current_shape: ",this.current_shape);
	if(this.current_shape==""){
		this._deactivate();
	}else{
		this.need_deactivate = true;
		this.setTarget("");
	}
	this.is_active = false;
}

VIZ.LINE._deactivate = function(){
	console.log(this.log_prfx+"deactivated");
	var self = this;
	//dispatchEvent(new Event("viz:LINE:deactivated"));
	TweenLite.to( this.mesh.material, .15, {
		opacity: 0,
		ease: Quad.easeIn,
		onComplete: function(){
			if(self.onDeactivated) self.onDeactivated();
			self.mesh.visible = false;
			self.is_paused = true;
		}
	})	
}
//var z_max = 0;
VIZ.LINE.update = function(delta){
	if(!this.is_inited || this.is_paused) return;
	
	this.mesh.position.x = VIZ.view_coef_x*.8;
	this.mesh.position.y = -VIZ.view_coef_y*.4;
	
	if(this.is_complete) return;
	
	var v, dir;
	var ready_count = 0;
	for(var i=1; i<this.geo.vertices.length-1; i++){
		
		v = this.geo.vertices[i];

		//var vt = v.target;
		var vs = v.start;
		var vd = v.delta;
		
		var d = 1;
		v.offset += .78*delta;//.013
		if(v.offset<1.05){
			var o = Math.min( 1, Math.max(0, v.offset) );
			//var d = Math.easeInOutSine( o, 0, 1, 1 );
			var d = Math.easeInOutElastic( o, 0, 1, 1 );
		}else{
			ready_count++;
		}

		v.x = vs.x + vd.x*d;
		v.y = vs.y + vd.y*d;
		v.z = vs.z + vd.z*d;
	
		/*
		if(-v.z>z_max) {
			z_max = -v.z;
			console.log("z_max: ",(1-z_max));
		}
		*/
		var col = Math.min(Math.max( 0, 1+v.z*1.5 ), 1);
		this.geo.colors[i].setRGB(col,col,col,col);
	}

	if(ready_count>=this.geo.vertices.length-2 && !this.is_complete) {
		console.log(this.log_prfx+'is ready');
		this.is_complete = true;
		if(this.need_deactivate){
			this._deactivate();
		}else{
			//dispatchEvent(new Event("viz:LINE:ready"));
			if(this.onComplete) this.onComplete();
		}
	}
	//console.log(minz,maxz);
	this.geo.verticesNeedUpdate = true;
	this.geo.colorsNeedUpdate = true;
}

