VIZ.LINE.setDeltaPositionToTarget = function(v){
	v.start.x = v.x;
	v.start.y = v.y;
	v.start.z = v.z;
	v.delta.x = v.target.x - v.x;// delta movement
	v.delta.y = v.target.y - v.y;
	v.delta.z = v.target.z - v.z;
}
