VIZ.CAPTION.showText = function(_data){
	//console.log('showText. is_active:'+this.is_active+" NEXT:("+this.NEXT+") STRINGS_COUNT:"+this.STRINGS_COUNT);
	//console.log('showText. :',_data);
	if(!this.checkInited()) return;
	if(!this.is_active){
		this.NEXT = _data;
		return;
	}
	if(this.STRINGS_COUNT!=0){
		this.hideText(_data);
		return;
	}
	//
	if(!_data.scale) _data.scale = 1;
	if(!_data.x) _data.x = 0;
	if(!_data.y) _data.y = 0;
	if(!_data.align) _data.align = "left";
	this.TEXT_ALIGN = _data.align;

	this.SCALE_ADD = _data.scale;
	this.container_main.scale.set(_data.scale, _data.scale, _data.scale);
	
	this.is_active = false;
	var strings = _data.text.split('\n');
	this._count = this.STRINGS_COUNT = strings.length;
	for(var i=0; i<strings.length; i++){
		this.setPlane(strings[i], i);
	}
	//this.container_planes.position.x = _x;
	//this.container_planes.position.y = _y;
	this.moveText(_data.x, _data.y);
}

VIZ.CAPTION.hideText = function(_next){
	//console.log('hideText. is_active:'+this.is_active+" NEXT:("+this.NEXT+") STRINGS_COUNT:"+this.STRINGS_COUNT);
	if(!this.checkInited()) return;
	if(!this.is_active){
		if(!this.NEXT) this.NEXT = {};
		this.NEXT.text = 'H#I#D#E';
		return;
	}
	if(_next!=undefined) this.NEXT = _next;
	//
	var module = this;
	module._count = module.STRINGS_COUNT;
	for(var i=0; i<this.STRINGS_COUNT; i++){
		var mesh = this.meshes[i];
		var d = i*.02;
		var t = .6;
		TweenLite.to(mesh, t, {
			delay: d,
			_width_animate: .001,
			ease: Quad.easeIn,
			onUpdate: module.updateWidth.bind(mesh),
			onComplete: function(){
				module._count--;
				this.visible = false;
				if( module._count == 0 ){
					module.STRINGS_COUNT = 0;
					module.checkAfterComplete();
				}
			}.bind(mesh)
		});
		TweenLite.to(mesh.material, t/3, {
			opacity: 0,
			ease: Sine.easeIn
		});
	}
}

VIZ.CAPTION.setPlane = function ( _text, _line_n ) {
	//console.log('setPlane: ',_line_n,_text);
	var self = this;
	this.setTexture(_text.toUpperCase(), _line_n);
	var mesh = this.meshes[_line_n];
	mesh.position.y = this.OFFSET_Y + (this.STRINGS_COUNT-_line_n)*this.SCALE;
	mesh._width_animate = 0;
	mesh.visible = true;
	mesh.pulses = 2;	
	this.makePulse(mesh);
}

//
VIZ.CAPTION.makePulse = function (mesh) {
	var module = VIZ.CAPTION;
	TweenLite.to(mesh, .1, {
		delay: Math.random()*.03,
		_width_animate: Math.random()*.6+.5,
		ease: Sine.easeOut,
		onUpdate: module.updateWidth.bind(mesh),
		onComplete: function(){
			TweenLite.to(mesh, .3, {
				delay: Math.random()*.03,
				_width_animate: Math.random()*.5+.01,
				ease: Sine.easeIn,
				onUpdate: module.updateWidth.bind(mesh),
				onComplete: function(){
					mesh.pulses--;
					if(mesh.pulses>0) module.makePulse(mesh);
					else{
						var t = .6;
						TweenLite.to(mesh, t, {
							_width_animate: 1,
							ease: Quad.easeOut,
							onUpdate: module.updateWidth.bind(mesh),
							onComplete: function(){
								module._count--;
								if(module._count==0){
									module.checkAfterComplete();
								}
							}
						});
						TweenLite.to(mesh.material, t/2, {
							delay: t/2,
							opacity: 1,
							ease: Quad.easeInOut
						});
					}
				}
			});
		}
	});
}

VIZ.CAPTION.updateWidth = function () {
	var module = VIZ.CAPTION;
	var w = this._width_animate*this._width;
	this.scale.x = w;
	this.position.x = module.OFFSET_X;
	if(module.TEXT_ALIGN=="left")  this.position.x += w/2*module.SCALE;
		else if(module.TEXT_ALIGN=="right")  this.position.x -= w/2*module.SCALE;
	this.material.map.repeat.x = this._width_animate;
}

VIZ.CAPTION.checkAfterComplete = function () {
	//console.log('checkAfterComplete: NEXT:('+this.NEXT+'), STRINGS_COUNT:'+this.STRINGS_COUNT)
	this.is_active = true;
	if(this.NEXT){
		if(this.NEXT.text=='H#I#D#E'){
			if(this.STRINGS_COUNT) this.hideText('');
		}else{
			if(this.STRINGS_COUNT){// there is showed text
				this.hideText();
			}else{// there is nothing
				this.showText(this.NEXT);
				this.NEXT = undefined;
			}
		}
	}
}

//
VIZ.CAPTION.setTexture = function(_text, _line_n){
	var mesh = this.meshes[_line_n];
	if(!mesh) mesh = this.addMesh();
	canvas = this.canvases[_line_n];
	delete canvas;
	canvas = document.createElement("canvas");
	this.canvases[_line_n] = canvas;
	var h = 70*this.SCALE_ADD;
	var fnt = "bold "+Math.floor(h*.8)+"px "+this.FONT;
	var ctx = canvas.getContext("2d");
	ctx.font = fnt;
	//console.log(ctx.font);
	var xo = 20;

	var font_color = this.FONT_COLOR;
	var plane_color = this.PLANE_COLOR;
	var _t = _text.split("<INVERT>");
	if(_t.length>1){
		_text = _t[1];
		font_color = this.PLANE_COLOR;
		plane_color = this.FONT_COLOR;
	}
	
	
	var w = ~~ctx.measureText(_text).width;
	//console.log('text w: ',w);
	canvas.width = w+xo*2+xo;
	canvas.height = h;

	ctx.font = fnt;
	//ctx.clearRect(0, 0, canvas.width, canvas.height);
	ctx.fillStyle=plane_color;
	ctx.fillRect(0, 0, canvas.width, canvas.height);

	ctx.fillStyle = font_color;
	ctx.textAlign = "left";
    ctx.textBaseline = "middle";
	ctx.fillText( _text, xo, h/2+4 );

	mesh._width = canvas.width/h;
	var t = mesh.material.map = new THREE.Texture(canvas);
	t.generateMipmaps = false;
	t.magFilter = THREE.LinearFilter;
	t.minFilter = THREE.LinearFilter;
	mesh.material.map.needsUpdate = true;
}

VIZ.CAPTION.addMesh = function () {
	var g = new THREE.PlaneGeometry( this.SCALE, this.SCALE, 1, 1 );
	var m = new THREE.MeshBasicMaterial();
	m.transparent = true;
	m.opacity = 0;
	var mesh = new THREE.Mesh(g,m);
	this.meshes.push(mesh);
	this.container_planes.add(mesh);

	// back
	var back = mesh.clone();
	mesh.add(back);
	back.z = 1;
	var m_back = new THREE.MeshBasicMaterial({color:0xffffff});
	back.material = m_back;

	mesh.scale.x = 0.001;

	return mesh;
}

VIZ.CAPTION.moveText = function(_x, _y){
	this.container_planes.position.x = _x;
	this.container_planes.position.y = _y;
}
