VIZ.showBlock = function(_id){
	
	var text_delay = 1000;
	var _data = VIZ.BLOCK_DATA[_id];

	if(_data.type=='line'){
		if(VIZ.LINE_DOTS.is_active) VIZ.LINE_DOTS.deactivate();
		if(!VIZ.LINE.is_active) {
			VIZ.LINE.activate();
			VIZ.LINE.onComplete = function(){
				VIZ.LINE.onComplete = undefined;
				VIZ.LINE.setTarget(_id);
			};
			text_delay += 500;
		}else{
			VIZ.LINE.setTarget(_id);
		}
	}else if(_data.type=='dot'){
		if(VIZ.LINE.is_active) VIZ.LINE.deactivate();
		if(!VIZ.LINE_DOTS.is_active) {
			VIZ.LINE_DOTS.activate();
			VIZ.LINE_DOTS.onComplete = function(){
				VIZ.LINE_DOTS.onComplete = undefined;
				VIZ.LINE_DOTS.setTarget(_id);
			};
			text_delay += 500;
		}else{
			VIZ.LINE_DOTS.setTarget(_id);
		}
	}else if(_data.type=='title'){
		if(VIZ.LINE.is_active) VIZ.LINE.deactivate();
		if(VIZ.LINE_DOTS.is_active) VIZ.LINE_DOTS.deactivate();
		text_delay = 0;
	}
	
	VIZ.CAPTION.hideText();
	setTimeout( function(){
		VIZ.CAPTION.FONT = 'proxima_nova_thextrabold';
		VIZ.CAPTION.FONT_COLOR = "#212121";
		VIZ.CAPTION.showText( _data );
	}, text_delay );
}

VIZ.hideBlock = function(){
	VIZ.LINE.deactivate();
	VIZ.LINE_DOTS.deactivate();
	VIZ.CAPTION.hideText();
}